// dotenv fetch
require('dotenv').config();

// canvas 설정
const { loadImage } = require('canvas');

// Konva 설정
const Konva = require('konva-node');
const stage = new Konva.Stage({
  width: 1000,
  height: 1064,
});

// 배경 설정
const backgroundLayer = new Konva.Layer();
const backgroundRect = new Konva.Rect({
  x: 0,
  y: 0,
  width: stage.width(),
  height: stage.height(),
  fill: 'white',
});
backgroundLayer.add(backgroundRect);
stage.add(backgroundLayer);

// 객체 레이어 설정
const layer = new Konva.Layer();
stage.add(layer);

// s3 가져오기
const {
  putObject,
  fileExist,
  fileURL,
  deleteFolder,
} = require('./modules/s3_util');

// crypto 가져오기
const crypto = require('crypto');

// util 가져오기
const { statusCode } = require('./modules/util');

/* 지도 캡처본 만들기 */
module.exports.handler = async (ctx, context) => {
  // lambda handler 기본 환경설정
  context.basePath = process.env.BASE_PATH;
  context.callbackWaitsForEmptyEventLoop = false;

  // 파라미터 가져오기
  const mid = ctx.mid;
  const represents = ctx.represents;
  console.log({ mid, represents });

  // 변수 선언
  const cityKeys = Object.keys(represents);
  const images = {};

  // 대표사진 객체에서 해쉬키를 뽑아낸다.
  const hashKey =
    'capture/' +
    base64url_encode(
      crypto
        .createHash('sha256')
        .update(JSON.stringify(represents))
        .digest('base64')
    );
  console.log({ hashKey });

  // 해쉬키가 동일한지 체크
  const fileCheck = await fileExist(mid, hashKey);
  console.log({ fileCheck });

  // 객체의 일부가 변경되었다면
  if (!fileCheck) {
    // 이전의 캡처본을 삭제
    await deleteFolder(`${mid}/capture`);
    layer.destroyChildren();

    // 이미지들을 로드
    for (let cityKey of cityKeys) {
      console.log(represents[cityKey]);
      if (represents[cityKey] == null) images[cityKey] = null;
      else images[cityKey] = await loadImage(represents[cityKey]);
    }
    console.log(images);

    // 독도 로드
    const dokdoImage = await loadImage(
      process.env.S3_CUSTOM_DOMAIN + 'dokdo.svg'
    );
    const dokdo = new Konva.Image({
      width: 100,
      height: 50,
      x: 850,
      y: 300,
      image: dokdoImage,
    });
    layer.add(dokdo);

    // stage에 path들을 그린다.
    for (let cityKey of cityKeys) {
      console.log(cityKey);

      if (cityKey === 'jeju')
        drawPath(cityKey, images[cityKey], -85.2888, -997.914 + 30);
      else drawPath(cityKey, images[cityKey], 0, 30);
    }
    stage.draw();

    // 이미지를 png로 저장
    const img = stage.toDataURL();
    const buf = Buffer.from(
      img.replace(/^data:image\/\w+;base64,/, ''),
      'base64'
    );

    // s3에 저장
    await putObject(mid, buf, hashKey);
  }

  return {
    statusCode: statusCode.success,
    body: process.env.S3_CUSTOM_DOMAIN + fileURL(mid, hashKey),
  };
};

// base64에서 /를 삭제
function base64url_encode(str) {
  return str.replace(/\+/gi, '-').replace(/\//gi, '_');
}

// stage에 path 그리기
function drawPath(cityKey, image = null, x = 0, y = 0) {
  console.log({ x, y });
  const path = representsSVG[cityKey];
  const pathData = new Konva.Path({
    stroke: 'white',
    strokeWidth: 5,
    shadowColor: 'black',
    shadowBlur: 20,
    shadowOpacity: 0.5,
    data: path,
    x,
    y,
  });
  if (image != null) {
    pathData.fillPatternImage(image);
    pathData.fillPatternRepeat('no-repeat');
    var scaleX = imageOffset[cityKey].width / image.width;
    var scaleY = imageOffset[cityKey].height / image.height;
    pathData.fillPatternOffset({
      x: (-1 * (imageOffset[cityKey].x - pathData.x())) / scaleX,
      y: (-1 * (imageOffset[cityKey].y - pathData.y() + 30)) / scaleY,
    });
    pathData.fillPatternScale({
      x: scaleX,
      y: scaleY,
    });
  }
  layer.add(pathData);
}

